import './navbar.css';
import {Button} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

function NavBar(props) {
  const style = {fontSize: "1.5vw", fontFamily: "'Annie Use Your Telescope'", marginLeft: "20px", marginTop: "5px", color: "#000", opacity: "50%"}

  return (
    <div className="width-100">
      <Button sx={style} className="text-center darken">Resume</Button>
      <Button sx={style} className="text-center darken">Projects</Button>
      <Button sx={style} className="text-center darken">Research</Button>
      <Button sx={style} className="text-center darken">Work</Button>
      <Button sx={style} className="text-center darken">Contact</Button>
    </div>
  )
}

export default NavBar;
